import React from 'react';

const products = [
  {
    name: 'Matcha Latte Kem Phô Mai',
    category: 'Trà sữa',
    price: 50000,
    status: 'Đang bán',
    sold: 120
  },
  {
    name: 'Cà Phê Sữa Đá',
    category: 'Cà phê',
    price: 25000,
    status: 'Đang bán',
    sold: 85
  }
];

function MenuTable() {
  return (
    <table className="table">
      <thead>
        <tr>
          <th>Tên món</th>
          <th>Danh mục</th>
          <th>Giá</th>
          <th>Trạng thái</th>
          <th>Đã bán</th>
          <th>Hành động</th>
        </tr>
      </thead>
      <tbody>
        {products.map((item, index) => (
          <tr key={index}>
            <td>{item.name}</td>
            <td>{item.category}</td>
            <td>{item.price.toLocaleString()}₫</td>
            <td>{item.status}</td>
            <td>{item.sold}</td>
            <td>
              <button className="button">Chỉnh sửa</button>{' '}
              <button className="button">Xoá</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default MenuTable;
